const numCtx = React.createContext < number > 0;
const updateNumCtx = React.createContext<React.Dispatch<number>>(() => {});

function Button() {
  const updateNum = useContext(updateNumCtx); // updateNum\u662F\u4E00\u4E2Adispatch\uFF0C\u5B83\u662F\u4E0D\u53D8\u7684\u3002
  console.log('btn render');
  return <button onClick={() => updateNum(Date.now())}>\u4EA7\u751F\u968F\u673A\u6570</button>;
}

function Show() {
  const num = useContext(numCtx); // \u7528\u5230\u4E86context\u91CC\u9762\u7684num\uFF0C\u6240\u4EE5num\u6539\u53D8\u65F6\u4F1A\u89E6\u53D1\u91CD\u65B0\u6E32\u67D3\u3002
  return <p>num is: {num}</p>;
}

const Middle = () => {
  return (
    <>
      <Button />
      <Show />
    </>
  );
};

export default function App() {
  const [num, updateNum] = useState(0);

  return (
    <numCtx.Provider value={num}>
      <updateNumCtx.Provider value={updateNum}>
        <Middle />
      </updateNumCtx.Provider>
    </numCtx.Provider>
  );
}
`,paraId:51,tocIndex:11},{value:"\u5982\u4E0A\u4EE3\u7801\u6240\u793A\uFF0C\u867D\u7136 Middle \u4E0D\u63A5\u6536\u4EFB\u4F55 props\uFF0C\u4F46\u662F\u5B9E\u9645\u4E0A props \u662F",paraId:52,tocIndex:11},{value:"{}",paraId:52,tocIndex:11},{value:", react \u5728\u7528\u5168\u7B49\u6BD4\u8F83\u7684\u65F6\u5019\uFF0C",paraId:52,tocIndex:11},{value:"{}",paraId:52,tocIndex:11},{value:"\u548C",paraId:52,tocIndex:11},{value:"{}",paraId:52,tocIndex:11},{value:"\u4E0D\u4F1A\u8BA4\u4E3A\u662F\u76F8\u7B49\u7684\uFF0C\u6240\u4EE5 APP \u7EC4\u4EF6\u53D1\u751F\u91CD\u65B0\u6E32\u67D3\u7684\u65F6\u5019\uFF0CMiddle \u7EC4\u4EF6\u4E5F\u4F1A\u8DDF\u7740\u91CD\u65B0\u6E32\u67D3\uFF0C\u4ECE\u800C\u4F7F\u5B83\u7684 Button \u5B50\u7EC4\u4EF6\u4E5F\u8DDF\u7740\u91CD\u65B0\u6E32\u67D3\u3002",paraId:52,tocIndex:11},{value:"\u6211\u4EEC\u53EF\u4EE5\u4F7F\u7528",paraId:53,tocIndex:11},{value:"memo",paraId:53,tocIndex:11},{value:"\u6216\u8005",paraId:53,tocIndex:11},{value:"useMemo",paraId:53,tocIndex:11},{value:"\u6765\u89E3\u51B3 Middle \u7EC4\u4EF6\u7684\u91CD\u65B0\u6E32\u67D3\u95EE\u9898\u3002",paraId:53,tocIndex:11},{value:`// \u4F7F\u7528memo
